pragma solidity ^0.4.21;

contract Campaign {
    address public owner;
    address[] public donators;
    mapping(address => uint) donations;
    uint public fundCall;
    uint public timeLock;

    constructor(address _owner, uint _fundCall, uint _timeLock) public {
        require(_fundCall != 0 && _timeLock != 0);
        owner = _owner;
        fundCall = _fundCall * 1 wei;
        timeLock = now + _timeLock * 1 seconds;
    }

    function donate() public payable {
        require(msg.value > 0);
        if(isDonator(msg.sender)) {
            donations[msg.sender] += msg.value;
        } else {
            donators.push(msg.sender);
            donations[msg.sender] = msg.value;
        }
    }

    function isDonator(address who) internal view returns(bool) {
        if (who != 0x0 && donations[who] > 0) {
            return true;
        }
        return false;
    }

    function withdraw() public _onlyOnwner _campaignExpired _enoughFund{
        // require(msg.sender == owner);
        owner.transfer(address(this).balance);
    }

    function currentBalance() view public returns(uint) {
        return address(this).balance;
    }

    function getDonations() public view returns(address[], uint[]) {
        uint amountDonators = donators.length; 
        uint[] memory _donations = new uint[](amountDonators);
        for(uint i = 0; i < donators.length; i ++) {
            _donations[i] = (donations[address(donators[i])]);
        }
        return (donators, _donations);
    }

    function refund() public  {
        require(msg.sender == owner || (now >= timeLock && address(this).balance < fundCall));
        for (uint i = 0; i < donators.length; i++) {
            donators[i].transfer(donations[address(donators[i])]);
        }
    }

    modifier _onlyOnwner(){
        require(msg.sender == owner, "Only owner can do");
        _;
    }

    modifier _campaignExpired() {
        require(now >= timeLock, "Must enough time");
        _;
    }

    modifier _enoughFund() {
        require(address(this).balance >= fundCall, "Must enough fundCall");
        _;
    }
}
